class AdvancedNavPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
  
    };
    
  }
  render() {
    fetch('https://jsonplaceholder.typicode.com/todos/1' , {
      "method": "GET",
      "mode": "cors",  "content-type": "application/json",
      "accept": "application/json"
   
    })
  .then(response => response.json())
  .then(response => {
    this.setState({
     friends: response
    })
    console.log(this.state.friends)
 })
 return (
    <p>{response.json}</p>
      
    )
  }
}

